import React from 'react';
import {Link} from 'react-scroll'
import nightModeIcon from '../../assets/images/1x/nightModeIcon.png';
import s from './Navbar.module.css';

function Navbar() {
    return (
        <div className={s.body}>
            {/* logo */}
            <NavLink id={s.TigranMets} to='/home'>TigranMets </NavLink>
            <div className={s.right_menu}>
                {/*ձախ menu*/}
                <Link  to='/Skills' spy={true} smooth={true} >Skills </Link>
                <NavLink to='/Experiences'>Work Experiences </NavLink>
                <NavLink to='/Proficiency'>Proficiency </NavLink>
                <NavLink to='/'>Projects</NavLink>
                <NavLink to='/Achievements'>Achievements </NavLink>
                <NavLink to='/Blogs'>Blogs </NavLink>
                <NavLink to='/Contact_me'>Contact Me </NavLink>
                {/*night mode icon */}
                <NavLink to='/#'><img src={nightModeIcon} alt="night_mode_icon" /></NavLink>
            </div>
        </div>
    );
}

export default Navbar
